const HeaderComponent = () => {
    return(
        <>
        <header className="headebg-dark"> 
            <nav className="navbar navbar-expand-md navbar-dark bg-dark">
                <div><a href="https://www.hamiz.com" className="navbar-brand">Employee Management App</a></div>
            </nav>
        </header>
        </>
    );
}
export default HeaderComponent;
